	import httpClient from '@/utils/httpclient';
	import Alert from '@components/model'

	export default {
		name: 'user',
		components: {
			Alert
		},
		data() {
			return {
				fields: {
					Username: {
						key: 'Username',
						label: 'Username'
					},
					userEmail: {
						key: 'Email',
						label: 'Email'
					},
					city: {
						key: 'Phone',
						label: 'Phone'
					},
					Role: {
						key: 'Role',
						label: 'Role',
					},
					Dealership: {
						key: 'Dealership',
						label: 'Dealership'
					},
					status: {
						label: 'Active/Inactive'
					},
					action: {
						label: 'Action'
					},
				},
				items: null,
				data: null,
				currentPage: 1,
				rows: 1,
				perPage: 1,
		    totalPages:1,
        adminId:0,
				deleteUser: false,
				showAlerts: {
					title: '',
					content: '',
					show: false
				}
			}
		},
		mounted() {
			this.getList(1);
			this.adminId = this.$store.state.userInfo.userId;
		},
		methods: {
			getList(num) {
				let url = 'https://api-saas-qa.zus.ai/api/v1/listUserDeatil?pageNo=' + num + '&pageSize=10';
				httpClient.post(url).then((res) => {
					this.rows = res.data.data.rowCount;
					this.currentPage = res.data.data.pageNo;
					this.perPage = res.data.data.pageSize;
					this.totalPages = res.data.data.totalPages;
					console.log(res);
					this.data = res.data.data.datas;
					let myData = res.data.data.datas;
					let myItems = [];
					myData.map((item, i) => {
						myItems.push({
							Username: item.firstName + ' ' + item.lastName,
							Email: item.userEmail,
							Phone: item.phone,
							Role: item.role,
							userId: item.userId,
							status: item.status,
							Dealership: item.storeName,
							"Active/InActive": item.status === 1 ? 'Active' : 'InActive',
							Action: ''
						})
					});
					this.items = myItems
				})
			},
			turnToPage(p) {
		    this.getList(p);
			},
			delData(userid) {
				httpClient.post('https://api-saas-qa.zus.ai/api/v1/user/delete', {userId: userid}).then((res) => {
					if (res.data.data === true) {
						this.getList(1, 10)
					}
					console.log(res)
				}).catch((err) => {
				});
			},
			openBox(clickId) {
				let passData = {
					title: 'Are you sure to delete the user?',
					show: true,
					content: '',
					buttonText: {
						btnFirst: 'Cancel',
						btnSecond: 'OK',
						userId: clickId
					}
				};
				this.closeRemind(passData);
			},
			closeRemind(data) {
				this.showAlerts.show = data.show;
				this.showAlerts.title = data.title;
				this.showAlerts.content = data.content;
				this.showAlerts.buttonText = data.buttonText;
			},
			closeBox(data, ids) {
				this.showAlerts.show = !this.showAlerts.show;
				this.deleteUser = data !== 'Cancel';
				if (this.deleteUser === true) {
					this.delData(ids)
				}
			}
		}
	}
